import React, { useState } from "react";
import "./Sregister.css";


function Sregister() {
  const [fullName, setFullName] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [confirmPassword, setConfirmPassword] = useState("");
  const [Board, setBoard] = useState("");
  const [contactNumber, setContactNumber] = useState("");
  const [presentAddress, setPresentAddress] = useState("");
  const [subjects, setSubjects] = useState([]);
  const [addressProof, setAddressProof] = useState("");
  const [errors] = useState({});
  const [addressProofa, setAddressProofa] = useState('None');
  const [Query, setQuery] = useState("");
  const [classLevel, setClassLevel] = useState('1');

  const handleSubmit = (event) => {
    event.preventDefault();

 const formData = {
      fullName,
      email,
      password,
      confirmPassword,
      Board,
      contactNumber,
      presentAddress,
     
      subjects,
      addressProof,
    };

    console.log(formData);
  };

  return (
    <>
    
    <formabc onSubmit={handleSubmit}>
    <h1>Student Registration</h1>      
      <labelb>
        <b>Full Name</b>
        <input
          type="text"
          value={fullName}
          onChange={(event) => setFullName(event.target.value)} required
        />
        {errors.fullName && <div className="error">{errors.fullName}</div>}
      </labelb>
      <labelb>
        <b>Email</b>
        <input
          type="string"
          value={email}
          onChange={(event) => setEmail(event.target.value)}required
        />
        {errors.email && <div className="error">{errors.email}</div>}
      </labelb>
      <labelb>
       <b>Password</b>
        <input
          type="password"
          value={password}
          onChange={(event) => setPassword(event.target.value)}required
        />
        {errors.password && <div className="error">{errors.password}</div>}
      </labelb>
      <labelb>
        <b>Confirm Password</b>
        <input
          type="password"
          value={confirmPassword}
          onChange={(event) => setConfirmPassword(event.target.value)}required
        />
        {errors.confirmPassword && (
          <div className="error">{errors.confirmPassword}</div>
        )}
      </labelb>
      <labelb>
       <b>Board</b> 
        <input
          type="text"
          value={Board}
          onChange={(event) => setBoard(event.target.value)}required
        />
        {errors.education && <div className="error">{errors.education}</div>}
      </labelb>
      <labelb>
        <b>Class</b>
        <select value={classLevel} onChange={(e) => setClassLevel(e.target.value)}>
          {Array.from({ length: 12 }, (_, index) => index + 1).map((number) => (
            <option value={number} key={number}>
              {number}
            </option>
          ))}
        </select>
      </labelb>



      <labelb>
       <b>Contact Number</b> 
        <input
          type="number"
          value={contactNumber}
          onChange={(event) => setContactNumber(event.target.value)}required
        />
        {errors.contactNumber && (
          <div className="error">{errors.contactNumber}</div>
        )}
      </labelb>
      <labelb>
        <b>Present Address</b>
        <textarea
          value={presentAddress}
          onChange={(event) => setPresentAddress(event.target.value)}required
        />
        {errors.presentAddress && (
          <div className="error">{errors.presentAddress}</div>
        )}
      </labelb>
    
  
  <labelb>
    <b>Subject required</b>
    <input
      type="text"
      value={subjects}
      onChange={(event) => setSubjects(event.target.value)}required
    />
    {errors.subjects && <div className="error">{errors.subjects}</div>}
  </labelb>
  <labelb>
        <b>Address Proof</b>
        <select value={addressProofa} onChange={(e) => setAddressProofa(e.target.value)}>
          <option value="Aadhar">Aadhar Card</option>
          {/* <option value="DL">Driving License</option> */}
          <option value="passport">Passport</option>
          
        </select>
      </labelb>
  <label>
    <b>Address proof</b>
    
    <input
      type="file"
      onChange={(event) => setAddressProof(event.target.files[0])}
    />
    {errors.addressProof && (
      <div className="error">{errors.addressProof}</div>
    )}
   
  </label>
  
  <label>
        <b>Any Queries?</b>
        <textarea
          value={Query}
          onChange={(event) => setQuery(event.target.value)}required
        />
        {errors.Query && (
          <div className="error">{errors.Query}</div>
        )}
      </label>


  <button type="submit">Register</button>
</formabc>
</>
 );
}

export default Sregister;
